import React from 'react';
import s from './Dialog.module.css'
import NameDialog from './NameDialog/NameDialog'
const Dialog = () =>{
    return (
       <div>
           <div className={s.Dialog_container}>
        <NameDialog />
       <TextDialog/>
           </div>
       </div>
    );
}
export default Dialog;
